import React from "react";

function Project(props) {
  return (
    <div className="Project">
      <h1>{props.name}</h1>
      <h3>{props.date}</h3>
      <h4>{props.role}</h4>
      <p>
       {props.description}
      </p>
      <a>{props.link}</a>
    </div>
  );
}

export default Project;
